import React, { useState } from "react";

import Folder from "./Folder";

function Load({ data }) {
  const [expand, setExpand] = useState(false);

  return (
    <div>
      <div onClick={() => setExpand(!expand)} style={{ padding: "10px" }}>
        {data.name}
      </div>
    </div>
  );
}

export default Load;
